import React from 'react';
import "./first.css";
import Button from 'react-bootstrap/Button';
const First = () => {
  return (
    <div className='text'>
        <img 
        src="https://housemed.qodeinteractive.com/wp-content/uploads/2018/06/h1-slider-img-1.jpg" 
        alt="HouseMed" 
        style={{ width: '100%',height:'100vh' }} 
      />
      <div>
      <div className='animated-text'>
      Leading
      </div>
      <div className='animated-text-2'> 
      , healthcare
      </div>
      <div className='animated-text-3'>
      with compassion and innovation.
      </div>
      <div className='animated-text-par'>
        
      </div>
        <div className='animated-text-but'> 
        <Button variant="outline-success" >Appointment</Button>
        </div>
    </div>
    </div>
  );
}

export default First;
